import  "./SubmitButton.css";


const SubmitButton =()=>{

    const onSubmittingValues=()=>{
        return(
            console.log("In Submitting Button")
        );
    }

        return(

            <div className="main-box">
                <form onSubmit={onSubmittingValues}>
                    <div className="box1">
                            <div className="name-label">
                                 <label>Name </label>
                            </div>
                            <div className="main-name">
                                <input type= "text" />
                            </div>


                            <div className="age-label">
                                <label>Age </label>
                            </div>
                            <div className="main-age">
                                <input type= "text"  />
                            </div>

                        <div className="btn">
                            <button type="submit">SUBMIT</button>
                        </div>
                   </div>
                </form>
            </div>
        );
}

export default SubmitButton;
